import './App.css';
import { Component } from 'react';

const products = [
  {
    name: 'iPad',
    price: 200
  },
  {
    name: 'iPhone',
    price: 650
  }  
];

localStorage.setItem('products', JSON.stringify(products));

class App extends Component {
  componentDidMount() {
    const products = localStorage.getItem('products');
  }

  render() {
    return (
      <div className="App">
        <h1>Products Manager</h1>

      </div>
    )
  }
}

export default App;
